contracts/main.sol.content:
//SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.6.0;
pragma experimental ABIEncoderV2;


import "./Bus.sol";
import "./student.sol";

contract smartReservation{

    address manager;
    mapping(uint => Bus) bus;


    constructor(){
        manager = msg.sender;
    }

    // function addBus(uint _num, string memory _destination) public {
    function addBus(uint _num,string memory _destination) public{
        require(msg.sender == manager,
            "caller is not Manager");

        bus[_num] = new Bus(_num,_destination);
    }
}

contracts/student.sol.content:
//SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.6.0;
pragma experimental ABIEncoderV2;


contract Student{
    struct information{
        uint studentId;
        string studentName;
        address studentAddress;
    }

    information studentInfo = information(0,"null",owner);
    address private owner;

    constructor(){
        owner = msg.sender;
    }

    function addStudentInfo(uint id, string memory name) public {
        require(studentInfo.studentId == 0, "You'r infomation already registed"); // 학생 데이터 중복 생성 막음.
        studentInfo = information(id,name,owner);
    }

    function getStudentInfo() public view returns(uint,string memory,address){
        uint id = studentInfo.studentId;
        string memory name = studentInfo.studentName;
        address studentAdd = studentInfo.studentAddress;

        return (id,name,studentAdd);
    }

    // function reservationSeat
}

contracts/Bus.sol.content:

//SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.6.0;
pragma experimental ABIEncoderV2;


 contract Bus{

     struct seat{
         uint seatNum;
         uint studentId;
         address student;
     }

     address private student;
     uint256 busNum;
     string destination;

     constructor(uint _num, string memory _destination){
         busNum = _num;
         destination = _destination;
     }


     mapping(uint => seat) public busSeat;

    function reservationBus( uint _seatNum, uint _studentId, address _student) public {
        busSeat[_seatNum] = seat(_seatNum, _studentId, _student);
    }

 }

